import './App.css';
import {Testimonio} from './componentes/Testimonio';
function App() {
  return (
    <div className="App">
      <div>
        <h1>Esto es lo que dicen nuestros alumnos sobre freeCodeCamp:</h1>
        <Testimonio />
      </div>
    </div>
  );
}

export default App;
